import React from 'react'
import { BrowserRouter as Router, Route } from "react-router-dom"
import "boostrap/dist/css/bootstrap.min.css"
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <h3>Hello world!</h3>
      </div>
    </Router>
  );
}

export default App;
